import React from 'react'
import { NavLink } from 'react-router-dom'
import Sidebar from './dashboard'

function Admindashboard() {
  return (
    <div>
       <NavLink to="/Admin">
         <Sidebar/>
       </NavLink>

    </div>
  )
}

export default Admindashboard;
